import './App.css';
import './Filter.js';
import Filter from './Filter.js';
import HouseList from './HouseList.js';

function App() {
	return (
		<div className="App">
			<Filter></Filter>
			<div style={{ flexBasis: '100%' }} />
			<HouseList></HouseList>
		</div>
	);
}

export default App;
